import React from "react";
import toast, { Toaster } from "react-hot-toast";

const notify = () => toast("Here is your toast.");

const test = () => {
	const notify = () => toast("Wow so easy !");

	return (
		<div>
			<button onClick={notify}>Notify !</button>
			<ToastContainer />
		</div>
	);
};

export default test;
